import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';

const pageOne = () => {
    return <div>Page one</div>;
};

const pageTwo = () => {
    return <div>Page two</div>;
};

const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Route path="/" exact component={pageOne} />
        <Route path="/" exact component={pageTwo} />
      </BrowserRouter>
    </div>
  );
};

export default App;
